import React from 'react';

import '../style/value.css';

const Value = () => {
    return (
        <div className='tableValue'>
            <div className='value' onClick={value1}>5$</div>
            <div className='value' onClick={value2}>10$</div>
            <div className='value' onClick={value3}>25$</div>
            <div className='value' onClick={value4}>100$</div>
        </div>
    )
}
export default Value;
